import React from 'react';

const Product = ({ product }) => {
  return (
    <div className="product">
      <img src={product.image} alt={product.name} />
      <h2>{product.name}</h2>
      <p>{product.price} USD</p>
      <button>Add to Cart</button>
    </div>
  );
};

export default Product;
